import React from "react";
import styles from './Favorite.module.scss'
import Card from "./../Card/index.js";


const Favorite = (props) => {
    return (
        <section>
            <h1>Мои закладки</h1>
            {props.items.map(obj => (
                <Card
                    title={obj.title}
                    price={obj.price}
                    imageUrl={obj.imageUrl}
                />
            ))}
        </section>
    )
}

export default Favorite
